class Solution:
    def shortest_cycle(self, import_lines: List[str]) -> str:
        import_names = set(line.split(", ")[0] for line in import_lines)
        visited = set()
        visited.add("start")
        cycle = []
        stack = []

        def dfs(name):
            nonlocal cycle, visited, stack
            visited.add(name)
            if name not in visited:
                stack.append(name)
                while stack:
                    current = stack.pop()
                    if current in import_names:
                        return current, stack
                    cycle.append(current)
                    for import_name in import_lines:
                        if import_name.startswith(current + ", "):
                            dfs(import_name.split(", ")[0])
                            return current, stack
                stack.pop()
                cycle.append(current)
                return current, stack

        def find_cycle(start):
            nonlocal cycle
            visited = set()
            visited.add(start)
            while stack:
                current = stack.pop()
                if current == "start":
                    return cycle
                visited.add(current)
                for import_name in import_lines:
                    if import_name.startswith(current + ", "):
                        stack.append(import_name.split(", ")[0])
            return cycle

        for line in import_lines:
            if line.startswith("import"):
                line_names = line.split(", ")[0].split()
                for name in line_names:
                    dfs(name)

        if "start" in visited:
            return "SHIP IT"
        return " ".join(cycle)

