class Solution:
    def __init__(self, nodes):
        self.nodes = nodes

    def distance(self, node1, node2):
        return abs(node1.x - node2.x) + abs(node1.y - node2.y)

    def find_node(self, x, y):
        for node in self.nodes:
            if node.x == x and node.y == y:
                return node
        return None

    def find_parent(self, node):
        if node.parent is None:
            return None
        return self.find_node(node.parent.x, node.parent.y)

    def add_node(self, node):
        self.nodes.append(node)

    def parent_distance(self, node1, node2):
        parent1 = self.find_parent(node1)
        parent2 = self.find_parent(node2)

        if parent1 is not None and parent2 is not None:
            return self.distance(parent1, parent2)
        else:
            return float('inf')

    def distance(self, node1, node2):
        return abs(node1.x - node2.x) + abs(node1.y - node2.y)

    def minimum_distance(self):
        min_distance = float('inf')
        for i in range(len(self.nodes)):
            for j in range(i+1, len(self.nodes)):
                node1 = self.nodes[i]
                node2 = self.nodes[j]
                distance = self.distance(node1, node2)
                if distance < min_distance:
                    min_distance = distance
        return min_distance

